// ==UserScript==
// @name         MBSS La Musica
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  Звук новых сообщений
// @author       v.stazhok
// @match        https://support-admin-common-master.mbss.maxbit.private/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // === Точный URL системного звука ===
    const systemSoundURL = `data:audio/mpeg;base64,`; // обрезал для примера

    // === Дефолтный кастомный звук ===
    const defaultSound = `data:audio/mpeg;base64,`;

    let soundUrl = localStorage.getItem('customChatSound') || defaultSound;
    const startGain = parseFloat(localStorage.getItem('chatVolume')) || 3.0;

    // === Аудио движок ===
    const audioCtx = new (window.AudioContext || window.webkitAudioContext)();
    const gainNode = audioCtx.createGain();
    gainNode.gain.value = startGain;

    async function playCustom() {
        try {
            const response = await fetch(soundUrl);
            const arrayBuffer = await response.arrayBuffer();
            const audioBuffer = await audioCtx.decodeAudioData(arrayBuffer);
            const source = audioCtx.createBufferSource();
            source.buffer = audioBuffer;
            source.connect(gainNode).connect(audioCtx.destination);
            source.start(0);
        } catch (e) {
            console.error('Ошибка воспроизведения кастомного звука', e);
        }
    }

    // === Перехват системного звука ===
    const origPlay = HTMLMediaElement.prototype.play;
    HTMLMediaElement.prototype.play = function(...args) {
        try {
            if (this.src && this.src === systemSoundURL) {
                playCustom();
                return Promise.resolve(); // глушим оригинал
            }
        } catch (e) {
            console.error(e);
        }
        return origPlay.apply(this, args);
    };

function createUI() {
    // Загружаем сохранённую позицию
    let posX = parseInt(localStorage.getItem('soundPanelX') || 20, 10);
    let posY = parseInt(localStorage.getItem('soundPanelY') || 20, 10);

    const wrapper = document.createElement('div');
    wrapper.style.cssText = `
        position: fixed;
        left: ${posX}px;
        top: ${posY}px;
        z-index: 999999;
        font-family: sans-serif;
        text-align: center;
        background: rgba(0,0,0,0.85);
        padding: 8px;
        border-radius: 8px;
        color: white;
        cursor: grab;
        user-select: none;
    `;

    const toggleBtn = document.createElement('button');
    toggleBtn.textContent = '🔊';
    toggleBtn.title = 'Настройки звука';
    toggleBtn.style.cssText = `
        background: #444;
        color: white;
        border: none;
        border-radius: 50%;
        width: 40px;
        height: 40px;
        font-size: 18px;
        cursor: pointer;
    `;

    const panel = document.createElement('div');
    panel.style.cssText = `
        display: none;
        margin-top: 5px;
    `;

    // Ползунок громкости
    const slider = document.createElement('input');
    slider.type = 'range';
    slider.min = '0';
    slider.max = '10';
    slider.step = '0.1';
    slider.value = gainNode.gain.value;
    slider.style.width = '100px';
    slider.addEventListener('input', () => {
        gainNode.gain.value = parseFloat(slider.value);
        localStorage.setItem('chatVolume', slider.value);
        percentInput.value = Math.round(gainNode.gain.value * 100);
    });

    // Поле процентов
    const percentInput = document.createElement('input');
    percentInput.type = 'number';
    percentInput.min = '0';
    percentInput.max = '1000';
    percentInput.value = Math.round(gainNode.gain.value * 100);
    percentInput.style.cssText = `
        width: 60px;
        margin-left: 5px;
        text-align: right;
        color: black;
        background: white;
        border: 1px solid #ccc;
        border-radius: 4px;
    `;
    const applyBtn = document.createElement('button');
    applyBtn.textContent = 'OK';
    applyBtn.style.cssText = `
        margin-left: 5px;
        background: #666;
        color: white;
        border: none;
        padding: 2px 6px;
        border-radius: 4px;
        cursor: pointer;
    `;
    applyBtn.addEventListener('click', () => {
        const pct = parseFloat(percentInput.value);
        if (!isNaN(pct)) {
            const gain = pct / 100;
            gainNode.gain.value = gain;
            slider.value = gain;
            localStorage.setItem('chatVolume', gain);
        }
    });

    // Поле для загрузки своего звука
    const fileInput = document.createElement('input');
    fileInput.type = 'file';
    fileInput.accept = 'audio/*';
    fileInput.style.cssText = `margin-top: 5px; color: white;`;
    fileInput.addEventListener('change', (e) => {
        const file = e.target.files[0];
        if (file) {
            const reader = new FileReader();
            reader.onload = (ev) => {
                soundUrl = ev.target.result;
                localStorage.setItem('customChatSound', soundUrl);
                alert('Новый звук установлен!');
            };
            reader.readAsDataURL(file);
        }
    });

    // Поле для вставки URL
    const urlInput = document.createElement('input');
    urlInput.type = 'text';
    urlInput.placeholder = 'Вставьте URL звука';
    urlInput.style.cssText = `
        width: 150px;
        margin-top: 5px;
        color: black;
        background: white;
        border: 1px solid #ccc;
        border-radius: 4px;
    `;
    const urlBtn = document.createElement('button');
    urlBtn.textContent = 'Применить URL';
    urlBtn.style.cssText = `
        margin-left: 5px;
        background: #666;
        color: white;
        border: none;
        padding: 2px 6px;
        border-radius: 4px;
        cursor: pointer;
    `;
    urlBtn.addEventListener('click', () => {
        if (urlInput.value.trim()) {
            soundUrl = urlInput.value.trim();
            localStorage.setItem('customChatSound', soundUrl);
            alert('Новый звук установлен по URL!');
        }
    });

    // Кнопка теста
    const testBtn = document.createElement('button');
    testBtn.textContent = 'Проверить';
    testBtn.style.cssText = `
        margin-top: 5px;
        background: #666;
        color: white;
        border: none;
        padding: 4px 8px;
        border-radius: 4px;
        cursor: pointer;
    `;
    testBtn.addEventListener('click', playCustom);

    // Кнопка сброса
    const resetBtn = document.createElement('button');
    resetBtn.textContent = 'Сбросить на дефолт';
    resetBtn.style.cssText = `
        margin-top: 5px;
        background: #a33;
        color: white;
        border: none;
        padding: 4px 8px;
        border-radius: 4px;
        cursor: pointer;
    `;
    resetBtn.addEventListener('click', () => {
        localStorage.removeItem('customChatSound');
        soundUrl = defaultSound;
        alert('Звук сброшен на дефолтный!');
    });

    // Сборка панели
    const sliderRow = document.createElement('div');
    sliderRow.appendChild(slider);
    sliderRow.appendChild(percentInput);
    sliderRow.appendChild(applyBtn);

    panel.appendChild(sliderRow);
    panel.appendChild(document.createElement('br'));
    panel.appendChild(fileInput);
    panel.appendChild(document.createElement('br'));
    panel.appendChild(urlInput);
    panel.appendChild(urlBtn);
    panel.appendChild(document.createElement('br'));
    panel.appendChild(testBtn);
    panel.appendChild(document.createElement('br'));
    panel.appendChild(resetBtn);

    toggleBtn.addEventListener('click', () => {
        panel.style.display = panel.style.display === 'none' ? 'block' : 'none';
    });

    wrapper.appendChild(toggleBtn);
    wrapper.appendChild(panel);
    document.body.appendChild(wrapper);

    // === Перетаскивание панели ===
    let isDragging = false;
    let offsetX, offsetY;

    wrapper.addEventListener('mousedown', e => {
        if (e.target.tagName === 'INPUT' || e.target.tagName === 'BUTTON') return;
        isDragging = true;
        offsetX = e.clientX - wrapper.offsetLeft;
        offsetY = e.clientY - wrapper.offsetTop;
        wrapper.style.cursor = 'grabbing';
    });

    document.addEventListener('mousemove', e => {
        if (!isDragging) return;
        posX = e.clientX - offsetX;
        posY = e.clientY - offsetY;
        wrapper.style.left = posX + 'px';
        wrapper.style.top = posY + 'px';
    });

    document.addEventListener('mouseup', () => {
        if (isDragging) {
            isDragging = false;
            wrapper.style.cursor = 'grab';
            localStorage.setItem('soundPanelX', posX);
            localStorage.setItem('soundPanelY', posY);
        }
    });
}




createUI();
 })();
